Day Five of #StrongArmAsanas2 challenge: EPK Prep (within flow). As you might have guessed from yesterday, I can't arm balance (yet) so I am doing simple prep poses when the actual pose is not part of my practice. EPK is well outside my practice, so I did a little prep for it instead, and practiced coming up on my toe and taking the weight in my arms; I still need to work on straightening my back leg, but that will come. I did this as part of a small flow this evening, as I needed a bit of self-care after a nasty incident at a shopping centre today.

I am currently redecorating my room into a small 'sanctuary space' and I needed to head out to the shops for fairy lights. As I left the store, I was herded (I don't know how else to describe it) into a corner by a man, who groped me and tried to take my handbag. I screamed and lashed out, while he scarpered and I got told off by a security guard for 'making a scene'. I told him I'd been groped and he shrugged it off with 'These things are best handled calmly'. TO HELL WITH THAT!!! Once I got home and got busy I felt better, but every time I paused I felt angry and sick again. I made some time for yoga this evening because I just needed to move, to reclaim my space, to challenge my mind in a safe, positive way. My body is mine, it belongs only to me, and yoga helps me remember that, while also quietening my mind. It was the self-care I needed before I tried to sleep. #metoo #yesallwomen #selfcare ğŸ’ªHosts:
